import React, { useState } from 'react';
import * as P from './styles';

const Patient: React.FC = () => {

    const Name = 'Gustav'


    return (

        <>

            <P.GlobalContainer>
                <P.Title>Welcome, {Name}</P.Title>
                <P.UtilSimpleRow>
                    <P.MedicationButton>Medical</P.MedicationButton>
                    <P.MedicationButton>Person Data</P.MedicationButton>
                </P.UtilSimpleRow>
            </P.GlobalContainer>

        </>

    );
};

export default Patient;
